import React from 'react';
import './ProfileCard.css';

const ProfileCard = (props) => {
    return (
        <div className="card-container">
            <div className="card">
              <div className="card-content">
                <img src="/images/profile.jpeg" className="img" alt="Profile" />
                <h3 className="card-title">{props.name}</h3>
                <p className="city">{props.city}</p>
                  <p className="card-description">
                 {props.description}
                  </p>
                  <div className="buttons">
                    <button className="btn btn-primary">Message</button>
                    <button className="btn btn-outline-primary">Follow</button>
                  </div>
                  <div className="skills">
                    <p>Skills</p>
                    <ul>
                        {props.skills.map((skill, index) => (
                            <li key={index}>skill</li>
                        ))}
                    </ul>
                  </div>
              </div>
            </div>
        </div>
    );
};

export default ProfileCard = () => {
    return <User name="Selvanarayanan" city="Sivakasi" description="Web Developer"
    skills={["UI/UX", "Front End Developer", "MEAN Stack", "MERN Stack", "App Developer", "Backend"]} />;
};
